INSERT INTO `lang_serv` VALUES (4,2,'Cable television','Cable television is a system of delivering television programming to consumers via radio frequency ','A \"cable channel\" (sometimes known as a \"cable network\") is a television network available via cable television. When available through satellite television, including direct broadcast satellite providers such as DirecTV, Dish Network and Sky, as well as via IPTV providers such as Verizon FIOS and AT&T U-verse, this is referred to as a \"satellite channel\".'),(5,2,'Кабельное телевидение','Кабельное телевидение противопоставляется эфирному и спутниковому телевидению. Оно было изобретено в США в 1949 году.','Сети кабельного телевидения начали активно развиваться в Европе и США в 1980-х годах; в СССР/России первые кабельные сети появились в конце 1980-х — начале 1990-х годов. Долгое время основой кабельных телесетей является коаксиальный кабель. Успешное развитие технологий оптической передачи данных привело к внедрению оптоволокна в сети кабельного телевидения в виде так называемых гибридных волоконно-коаксиальных сетей, в которых сочетаются коаксиальные и волоконно-оптические кабели.'),(4,1,'VoIP','Shot description about VoIP','Some long later about IP tehnologies'),(5,1,'IP Телефония','Краткое описание VoIP','Какае-то длинная статься о IP телефонии и похожих технологиях'),(4,31,'Internet','The Internet (or internet) is the global system of interconnected computer networks that uses the Internet protocol suite (TCP/IP) to communicate','Most traditional communication media, including telephony, radio, television, paper mail and newspapers are reshaped, redefined, or even bypassed by the Internet, giving birth to new services such as email, Internet telephony, Internet television, online music, digital newspapers, and video streaming websites. Newspaper, book, and other print publishing are adapting to website technology, or are reshaped into blogging, web feeds and online news aggregators. The Internet has enabled and accelerated new forms of personal interactions through instant messaging, Internet forums, and social networking. Online shopping has grown exponentially both for major retailers and small businesses and entrepreneurs, as it enables firms to extend their \"brick and mortar\" presence to serve a larger market or even sell goods and services entirely online. Business-to-business and financial services on the Internet affect supply chains across entire industries.'),(5,31,'Интернет','Упоминается как Всемирная сеть и Глобальная сеть, а также просто Сеть. Построена на базе стека протоколов TCP/IP.','Принципы, по которым строится Интернет, впервые были применены в сети ARPANET, созданной в 1969 году по заказу американского агентства DARPA. Используя наработки ARPANET, в 1984 году Национальный научный фонд США создал сеть NSFNET для связи между университетами и вычислительными центрами. В отличие от закрытой ARPANET подключение к NSFNET было достаточно свободным и к 1992 году к ней подключились более 7500 мелких сетей, включая 2500 за пределами США. С передачей опорной сети NSFNET в коммерческое использование появился современный Интернет.'),(6,31,'Інтернет','Інтерне́т (від англ. Internet), всемере́жжя, міжмере́жжя — всесвітня система сполучених комп\'ютерних мереж, що базуються на комплекті Інтернет-протоколів.','нтернет не має централізованого управління, правил використання чи доступу. Кожна складова мережа встановлює свої власні стандарти. Централізовано визначаються правила використання адресного простору Інтернет-протоколу та Системи доменних імен. Керує цим Інтернет-корпорація з присвоєння імен та номерів (англ. Internet Corporation for Assigned Names and Numbers, або ICANN), міжнародна некомерційна організація з головним офісом у США. Технічне обґрунтування і стандартизацію основних протоколів (IPv4 та IPv6) проводить Internet Engineering Task Force (IETF) — некомерційна організація, відкрита міжнародна спільнота проєктувальників, учених, мережевих операторів і постачальників послуг.\r\n\r\nМережа побудована на використанні протоколу IP і маршрутизації пакетів даних. В наш час Інтернет відіграє важливу роль у створенні інформаційного простору глобального суспільства, слугує фізичною основою доступу до веб-сайтів і багатьох систем (протоколів) передачі даних.'),(6,1,'IP Телефония','Короткий опис VoIP','Довга статися про IP телефонію та схожі технологї'),(6,2,'Кабельне телебачення','Кабельне телебачення протиставляється ефірному і супутниковому телебаченню. Воно було винайдено в США у 1949 році.','Мережі кабельного телебачення почали активно розвиватися в Європі і США в 1980-х роках; в СРСР / Росії перші кабельні мережі з\'явилися в кінці 1980-х - початку 1990-х років. Довгий час основою кабельних телемереж є коаксіальний кабель. Успішний розвиток технологій оптичної передачі даних привело до впровадження оптоволокна в мережі кабельного телебачення у вигляді так званих гібридних волоконно-коаксіальних мереж, в яких поєднуються коаксіальні та волоконно-оптичні кабелі.'),(4,36,'IP-TV','Internet Protocol television (IPTV) is the delivery of television content over Internet Protocol (IP) networks.','Although IPTV uses the Internet protocol it is not limited to television streamed from the Internet (Internet television). IPTV is widely deployed in subscriber-based telecommunications networks with high-speed access channels into end-user premises via set-top boxes or other customer-premises equipment. IPTV is also used for media delivery around corporate and private networks. IPTV in the telecommunications arena is notable for its ongoing standardisation process (e.g., European Telecommunications Standards Institute). '),(5,36,'IPTV','IPTV или Телевидение по протоколу интернета (Интерактивное телевидение) (англ. Internet Protocol Television) (IP-TV, IP-телевидение) — технология (стандарт) цифрового телевидения в сетях передачи данных по протоколу IP','В последнее время часто путается с технологией ОТТ, которая, в свою очередь является подклассом IPTV в области распространения видеоконтента. Кроме того, не следует путать и с интернет-телевидением, которое передаётся потоковым видео и доступно пользователю напрямую, без посредников (компаний-операторов). Отличительной особенностью IPTV стала возможность просмотра теле-программ с любого мобильного устройства: планшет, смартфон, ноутбук.'),(6,36,'IPTV','IP-TV, IP-телебачення (англ. Internet Protocol Television) — цифрове інтерактивне телебачення в мережах передачі даних за протоколом IP','Головними перевагами IPTV є інтерактивність відеопослуг і наявність широкого набору додаткових сервісів (Video on Demand (VoD), TVoIP, Time Shifted TV, Network Personal Video Recorder , Electronic Program Guide, Near Video on Demand). Можливості протоколу IP дозволяють надавати не тільки відеопослуги, але й набагато ширший пакет послуг, в тому числі інтерактивних та інтегрованих.\r\n\r\nКрім основних IPTV може включати в базовий пакет послуг ряд додаткових сервісів (Video Telephony, Voting, Information Portals, Web, Games, MOD KOD). Це можливо на основі уніфікації і стандартизації різних кінцевих пристроїв, інтеграції звуку, відео і даних на основі IP-протоколу та надання послуг на єдиній технологічній платформі. Відмінною особливістю IPTV стала можливість перегляду теле-програм з будь-якого девайса.'),(4,37,'Demo','Demo Service','Demo Service'),(5,37,'Демо Сервис','Режим для демонстрации функционала','Режим для демонстрации функционала'),(6,37,'Демо Сервіс','Режим для демонстрації функціоналу','Режим для демонстрації функціоналу');
