INSERT INTO `lang_tariffs` VALUES (4,1,'Student','For students only.','This rate is only for students who live in Ukraine.'),(5,1,'Студент','Только для студентов.','Этот тариф только для студентов из Украины.'),(6,1,'Студент','Тільки для студентів.','Цей тариф тільки для студентів, які мешкають в Україні.'),(4,2,'Retiree','Call your grandson.','Do you miss your grandson from Canada? Call him almost free!'),(5,2,'Пенсионер','Позвони внуку','Скучаешь по внуку из Канады? Позвони ему почти бесплатно!'),(6,2,'Пенсіонер','Зателефонуй онукові','Сумуєш за онуком з Канади? Подзвони йому майже безкоштовно!'),(4,3,'Lucky','Communication without limits','High quality communication, personal assistant, bonuses.'),(5,3,'Счастливчик','Связь без ограничений','Высокое качество связи, личный ассистент, бонусы.'),(6,3,'Щасливчик','Зв\'язок без обмежень','Висока якість зв\'язку, особистий асистент, бонуси.'),(4,4,'Easy start','50 cable channels','News, sports and more.'),(5,4,'Легкий старт','50 кабельных каналов','Новости, спорт и многое другое.'),(6,4,'Легкий старт','50 кабельних каналів','Новини, спорт та багато іншого.'),(4,5,'Standard','100 cable channels','News, sports, movies and more.'),(5,5,'Стандарт','100 кабельных каналов','Новости, спорт, кино и многое другое.'),(6,5,'Пенсіонер','100 кабельних каналів','Новини, спорт, кіно і багато іншого.'),(4,6,'Full','250 cable channels','News, sports, movies, cartoons, history, adventure and much more.'),(5,6,'Полный','250 кабельгых каналов','Новости, спорт, кино, мультики, история, приключения и многое другое.'),(6,6,'Полный','250 кабельгих каналів','Новини, спорт, кіно, мультики, історія, пригоди і багато іншого.'),(4,8,'Night','Night','Night'),(5,8,'Ночной','Ночной','Ночной'),(6,8,'Нічний','Нічний','Нічний'),(4,18,'Internet 100','Speed up to 100 Mbps','An ideal package that allows you to experience all the benefits of using the Internet at the highest speeds.'),(5,18,'Интернет 100','Скорость до 100 Мбит/с','Идеальный пакет, который дает возможность ощутить все преимущества пользования Интернетом на предельных скоростях.'),(6,18,'Інтернет 100','Швидкість до 100 Мбіт / с','Ідеальний пакет, який дає можливість відчути всі переваги користування Інтернетом на граничних швидкостях.'),(4,19,'Turbo','Speed up to 200 Mbps','Immerse yourself in an incredible Internet experience and experience the full benefits of turbo speeds up to 200 Mbps.'),(5,19,'Турбо','Скорость до 200 Мбит/с','Окунитесь в мир невероятных впечатлений Интернета и почувствуйте все преимущества турбоскорости до 200 Мбит/с.'),(6,19,'Турбо','Швидкість до 200 Мбіт / с','Пориньте в світ неймовірних вражень Інтернету і відчуйте всі переваги турбоскорості до 200 Мбіт / с.'),(4,20,'Fixed IP','Static (fixed) external IP address','A static address differs from a dynamic one only in that the latter can change every time you access the Internet, while the static one will be assigned to the subscriber and will not change when you access the Internet.'),(5,20,' Фиксированный IP','Статический (фиксированный) внешний IP-адрес','Статический адрес отличается от динамического лишь тем, что последний может меняться каждый раз, когда вы выходите в Интернет, статический же будет закреплен за абонентом и не будет меняться при выходе в Интернет.'),(6,20,'Фіксований IP','Статичний (фіксований) зовнішній IP-адрес','Статичний адреса відрізняється від динамічного лише тим, що останній може мінятися кожен раз, коли ви виходите в Інтернет, статичний ж буде закріплений за абонентом і не буде змінюватися при виході в Інтернет.'),(4,21,'Virus and SPAM protection','Zillya! Internet Security - provides an increased level of protection thanks to proactive protection modules.','For active Internet users, online shopping, social networks, free information search on the Internet.\r\nStay protected with Zillya! Internet\r\nSecurity.'),(5,21,'Защита от вирусов и СПАМа','Zillya! Internet Security – обеспечивает повышенный уровень защиты благодаря модулям проактивной защиты.','Для активных пользователей Интернет, покупок онлайн, социальных сетей, свободного поиска информации в Интернете.\r\nОставайтесь защищенными благодаря Zillya! Internet\r\nSecurity.'),(6,21,'Захист від вірусів і спаму','Zillya! Internet Security - забезпечує підвищений рівень захисту завдяки модулям проактивного захисту.','Для активних користувачів Інтернет, покупок онлайн, соціальних мереж, вільного пошуку інформації в Інтернеті.\r\nЗалишайтеся захищеними завдяки Zillya! Internet\r\nSecurity.'),(4,24,'Demo 1','Demo 1 short description','Demo 1 description'),(5,24,'Демо 1','Демо 1 короткое описание','Демо 1 описание.'),(6,24,'Демо 1','Демо 1 короткий опис','Демо 1 опис.'),(4,23,'Demo 2','Demo 2 short description','Demo 2 description'),(5,23,'Демо 2','Демо 2 короткое описание','Демо 2 описание.'),(6,23,'Демо 2','Демо 2 короткий опис','Демо 2 опис.'),(4,25,'Demo 4','Demo 4 short description','Demo 4 description'),(5,25,'Демо 4','Демо 4 короткое описание','Демо 4 описание.'),(6,25,'Демо 4','Демо 4 короткий опис','Демо 4 опис.'),(4,26,'Demo 5','Demo 5 short description','Demo 5 description'),(5,26,'Демо 5','Демо 5 короткое описание','Демо 5 описание.'),(6,26,'Демо 5','Демо 5 короткий опис','Демо 5 опис.'),(4,27,'Demo 6','Demo 6 short description','Demo 6 description'),(5,27,'Демо 6','Демо 6 короткое описание','Демо 6 описание.'),(6,27,'Демо 6','Демо 6 короткий опис','Демо 6 опис.'),(4,28,'Demo 7','Demo 7 short description','Demo 7 description'),(5,28,'Демо 7','Демо 7 короткое описание','Демо 7 описание.'),(6,28,'Демо 7','Демо 7 короткий опис','Демо 7 опис.'),(4,29,'Demo 8','Demo 8 short description','Demo 8 description'),(5,29,'Демо 8','Демо 8 короткое описание','Демо 8 описание.'),(6,29,'Демо 8','Демо 8 короткий опис','Демо 8 опис.'),(4,30,'Demo 9','Demo 9 short description','Demo 9 description'),(5,30,'Демо 9','Демо 9 короткое описание','Демо 9 описание.'),(6,30,'Демо 9','Демо 9 короткий опис','Демо 9 опис.'),(4,31,'Demo 10','Demo 10 short description','Demo 10 descript